-- View: adempiere.ftu_deferreddefectlist_v
DROP VIEW adempiere.ftu_deferreddefectlist_v;
CREATE OR REPLACE VIEW adempiere.ftu_deferreddefectlist_v AS SELECT dl.ad_client_id, dl.ad_org_id, dl.created, dl.createdby, dl.isactive, dl.ftu_defectlog_id, dl.defectdate, dl.defect AS defectdesc, dl.docstatus, jasc.JASCcode, jasc.name as JASCName, jasc.FTU_MaintJASCCode_ID, dl.deferreddate, dl.rectification, dl.repaireddate, dl.updated, dl.updatedby, dl.ftu_aircraft_id, r.name, ac.acmanufacturer, ac.acmodel, ac.acnextmaintdate, ac.acnextmainthrs FROM adempiere.ftu_defectlog dl right outer join adempiere.ftu_maintJASCCode jasc ON (dl.FTU_MaintJASCCode_ID = jasc.FTU_MaintJASCCode_ID), adempiere.ftu_aircraft ac, adempiere.s_resource r WHERE dl.ftu_aircraft_id = ac.ftu_aircraft_id AND ac.s_resource_id = r.s_resource_id AND dl.docstatus::text = 'MD'::text ORDER BY r.name, dl.deferreddate;
ALTER TABLE adempiere.ftu_deferreddefectlist_v OWNER TO adempiere;

Step.RollbackStatement:
-- View: adempiere.ftu_deferreddefectlist_v
DROP VIEW adempiere.ftu_deferreddefectlist_v;
CREATE OR REPLACE VIEW adempiere.ftu_deferreddefectlist_v AS SELECT dl.ad_client_id, dl.ad_org_id, dl.created, dl.createdby, dl.isactive, dl.ftu_defectlog_id, dl.defectdate, dl.defect AS defectdesc, dl.docstatus, dl.defecttype, dl.deferreddate, dl.rectification, dl.repaireddate, dl.updated, dl.updatedby, dl.ftu_aircraft_id, r.name, ac.acmanufacturer, ac.acmodel, ac.acnextmaintdate, ac.acnextmainthrs FROM adempiere.ftu_defectlog dl, adempiere.ftu_aircraft ac, adempiere.s_resource r WHERE dl.ftu_aircraft_id = ac.ftu_aircraft_id AND ac.s_resource_id = r.s_resource_id AND dl.docstatus::text = 'MD'::text ORDER BY r.name, dl.deferreddate;
ALTER TABLE adempiere.ftu_deferreddefectlist_v OWNER TO adempiere;
